public class InnerEndpointDeploymentConfigFactory(Action<Humidifier.SageMaker.EndpointTypes.DeploymentConfig> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.EndpointTypes.DeploymentConfig>
{

    internal InnerEndpointAutoRollbackConfigFactory AutoRollbackConfigurationFactory { get; set; }

    internal InnerEndpointRollingUpdatePolicyFactory RollingUpdatePolicyFactory { get; set; }

    internal InnerEndpointBlueGreenUpdatePolicyFactory BlueGreenUpdatePolicyFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointTypes.DeploymentConfig Create()
    {
        var deploymentConfigResult = CreateDeploymentConfig();
        factoryAction?.Invoke(deploymentConfigResult);

        return deploymentConfigResult;
    }

    private Humidifier.SageMaker.EndpointTypes.DeploymentConfig CreateDeploymentConfig()
    {
        var deploymentConfigResult = new Humidifier.SageMaker.EndpointTypes.DeploymentConfig();

        return deploymentConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointTypes.DeploymentConfig result)
    {
        base.CreateChildren(result);

        result.AutoRollbackConfiguration ??= AutoRollbackConfigurationFactory?.Build();
        result.RollingUpdatePolicy ??= RollingUpdatePolicyFactory?.Build();
        result.BlueGreenUpdatePolicy ??= BlueGreenUpdatePolicyFactory?.Build();
    }

} // End Of Class

